import React from 'react';
import logo from './logo.svg';
import './App.css';
const firstName = 'Khalid';
const lastName = 'Almuqbil';
const project = 'Hand Written Arabic Digits';
const tools = {
  languages : 'Python ,JavaScript',
  library : 'Keras ,TensorFlow ,Numpy ,Pandas ,Matplotlib ,Flask ,JQurey',
  otherTools : 'Jupyter Notebook , Bitpacket'
}
const blogObj = {
  title : 'Khalid Space',
  description : 'This my first blog',
  topic : 'Hand Written'
}
function App() {
  return (
    <div className="App">
      <h1>{blogObj.title}</h1>
      <h3>{blogObj.description}</h3>
      <h4>{blogObj.topic}</h4>
      <p>Languages :{tools.languages}</p>
      <p>Other Tools : {tools.otherTools}</p>
    </div>
  );
}

export default App;
